import React from 'react';
import './Faq.css';


function Faq() {
    return (
        <div className='faq__container'>
            <ul className='faq__columns'>
                <li><img src='images/faq.jpg' className='faq__img'/></li><li><img src='images/faq.jpg' className='faq__img'/></li>
            </ul>
        </div>
    );
}

export default Faq;
